import React from 'react';
import './Form.css';
import PropTypes from 'prop-types';
import { FaPlus } from 'react-icons/fa';

export default function Form(changeInput, changeSubmit, newTask){
  return (
    <form onSubmit={changeSubmit} className="form">
      <input
        type="text"
        onChange={changeInput}
        value={newTask}
      />

      <button type="submit">
        <FaPlus />
      </button>
    </form>

  );
}

Form.propTypes = {
  changeInput: PropTypes.func.isRequired,
  _changeSubmit: PropTypes.func.isRequired,
  get changeSubmit() {
    return this._changeSubmit;
  },
  set changeSubmit(value) {
    this._changeSubmit = value;
  },
  newTask: PropTypes.string.isRequired,
};
